import React, { useState, useEffect } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import axios from 'axios';
import { Link } from 'react-router-dom';

const API_BASE_URL = process.env.REACT_APP_API_BASE_URL;

const StudentManagement = () => {
  const [students, setStudents] = useState([]);
  const [email, setEmail] = useState('');
  const [name, setName] = useState('');
  const [nickname, setNickname] = useState('');
  const [birthDate, setBirthDate] = useState('');
  const [nationality, setNationality] = useState('');
  const [residence, setResidence] = useState('');
  const [zoomMeetingDate, setZoomMeetingDate] = useState('');
  const [registrationStatus, setRegistrationStatus] = useState('');
  const [freeClassTeacher, setFreeClassTeacher] = useState('');
  const [level, setLevel] = useState('');
  const [assignedClass, setAssignedClass] = useState('');
  const [scheduledStartDate, setScheduledStartDate] = useState('');
  const [discount, setDiscount] = useState('');
  const [availableTime, setAvailableTime] = useState('');
  const [memo, setMemo] = useState('');
  
  useEffect(() => {
    axios.get(`${API_BASE_URL}/StuLoad`)
      .then(response => {
        setStudents(response.data);
      })
      .catch(error => {
        console.error('데이터를 불러오는 데 실패했어', error);
      });
  }, []);

  return (
    <div className="container d-flex flex-column align-items-start">
      <h1 className="mt-3 mb-3">학생 관리</h1>
      <div className="mb-3 d-flex justify-content-between">
        <div>
        <button className="btn btn-primary" style={{ marginRight: '10px' }}>전체 신청자</button>
          <button className="btn btn-secondary" style={{ marginRight: '10px' }}>줌미팅 등록</button>
          <button className="btn btn-secondary" style={{ marginRight: '10px' }}>줌미팅 완료</button>
          <button className="btn btn-secondary" style={{ marginRight: '10px' }}>재학 학생</button>
          <button className="btn btn-secondary" style={{ marginRight: '10px' }}>휴학 학생</button>
          <button className="btn btn-secondary" style={{ marginRight: '10px' }}>졸업 학생</button>
        </div>
        <Link to="/signup">
              <button className="btn btn-secondary">학생 생성</button>
        </Link>
      </div>
      <table className="table" style={{ whiteSpace: 'nowrap' }}>
        <thead>
          <tr>
            <th>신청일시</th>
            <th>이름</th>
            <th>애칭</th>
            <th>이메일</th>
            <th>생년월일</th>
            <th>국적</th>
            <th>거주도시</th>
            <th>줌 미팅 예정일시</th>
            <th>등록 상황</th>
            <th>무료 수업 강사</th>
            <th>레벨</th>
            <th>배정 클래스</th>
            <th>수업 시작 예정일</th>
            <th>할인</th>
            <th>수업 가능 시간</th>
            <th>메모</th>
          </tr>
        </thead>
        <tbody>
        {students.map((student, index) => (
          <tr key={index}>
            <td>{student.createdAt}</td>
            <td>{student.User.username}</td>
            <td>{student.Nickname}</td>
            <td>{student.User.email}</td>
            <td>{student.User.birth}</td>
            <td>{student.User.Nationality}</td>
            <td>{student.User.currentCity}</td>
            
          </tr>
        ))}
      </tbody>
      </table>
      <button className="btn btn-info">더 보기</button>
    </div>
  );
};

export default StudentManagement;
